import React from "react";
import "../components/css/Projects.css";

type ProjectItem = {
  title: string;
  subtitle: string;
};

const projectList: ProjectItem[] = [
  {
    title: "'PAWMEET' Application",
    subtitle: "UI & UX",
  },
  {
    title: "InfoSafe Application",
    subtitle: "Web Design",
  },
  {
    title: "Urban Legend Application",
    subtitle: "UI & UX",
  },
  {
    title: "Echo",
    subtitle: "UI design and Web game",
  },
];

const Projects: React.FC = () => {
  return (
    <section id="projects" className="projects-section">
      <div className="projects-container">
        <h2 className="projects-title">Projects</h2>

        {/* 大框背景图 */}
        <div className="project-box">
          <img
            src="/public/frame2.png"
            alt="Project Box Background"
            className="project-box-bg"
          />

          {/* 项目列表 */}
          <div className="project-list">
            {projectList.map((item, idx) => (
              <div
                key={idx}
                className={`project-item ${idx === 0 ? "first-item" : ""}`}
              >
                <h3 className="project-item-title">{item.title}</h3>
                <p className="project-item-subtitle">{item.subtitle}</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Projects;
